import { Container, Gradient, Button, Scroll, ScrollWheel } from './HomeElements';
import Background from '../../Images/home-background.png';

const Home = () => {
    return (
        <Container image={Background}>
            <Gradient>
                <span style={{color: 'white'}}>Julian van Beek</span><br />
                <span style={{color: 'white'}}>Web Designer</span>

                <div style={{color: 'rgba(255,255,255, .5'}}>
                Creative
                Tech-savvy
                Passionated
                Eager to learn
                Customer oriented
                Result driven
                </div>

                <Button to='/portfolio'>View Projects</Button>
                <Scroll>
                    <ScrollWheel />
                </Scroll>
            </Gradient>
        </Container>
    );
}

export default Home;
